    false,nt"url": null,nt"notes": "NODC Accession 0112169 includes marine
    mammal observation and biological data collected aboard the LAURENCE M. GOULD and
    NATHANIEL B. PALMER during cruises LMG0103, NBP0103 and NBP0104 in the South Atlantic
    Ocean and South Pacific Ocean from 2001-03-21 to 2001-08-28. These data include
    MARINE MAMMALS. The instruments used to collect these data include acoustic sensor.
    These data were collected by John Hildebrand of University of California-San Diego
    as part of Southern Ocean GLOBEC. The Biological and Chemical Oceanography Data
    Management Office (BCO-DMO) submitted these data to NODC on 2013-07-31.nnThe following
    is the text of the abstract provided by BCO-DMO:nnWorking Procedure:nA sonobuoy
    is deployed and monitored until it is out of range. The length of time the sonobuoy
    can be heard depends on the speed of the ship, the sonobuoy's direction relative
    to the ship and the prevailing sea, ice and weather conditions. When a whale is
    heard, an attempt is made to identify the species and note it. If a seal is heard,
    it is just noted as a seal. The sonobuoy was set to scuttle after 8 hours.nnQuestions
    regarding these data should be directed to:nJohn HildebrandnScripps Institution
    of Oceanography, UCSDn9500 Gilman DrivenLa Jolla CA, 92093-0205nnEmail: jhildebrand@ucsd.edunnLast
